import React, { Component } from 'react'

class Container1 extends Component {

    constructor(props){
        super(props);
        this.state={
            level:"init"
        }
    }
    render() {
        return (
            <div>
                max is  {this.props.max} and type is {this.props.nick}
            </div>
        );
    }
}



export default Container1;
